INSERT INTO home_menu_sections VALUES(1,'General','General','1','The DMS is part of PRISM, the Proteomics Research Information Storage and Management System. DMS acquires data from mass spectrometers, collects laboratory information, and tracks and controls the intermediate data processing. ');
INSERT INTO home_menu_sections VALUES(2,'Campaign','Campaign','2','Campaign is the overarching umbrella for a particular research interest. Everything in DMS flows up to a campaign.');
INSERT INTO home_menu_sections VALUES(3,'Material Storage','Material Storage','3','Material Storage is used to keep track of Biomaterial and injectable samples (Experiments) in our freezers. All tracked biomaterial must be in a container and that container (box) must have its freezer location recorded in DMS.');
INSERT INTO home_menu_sections VALUES(4,'Biomaterial','Cell Culture/Biomaterial','4','Biomaterial/Cell Culture refers to the physical sample of biological material, often in its raw form. It is usually something sent to us by a user or collaborator.');
INSERT INTO home_menu_sections VALUES(5,'Sample Prep','Sample Preparation','5','Biomaterial is typically processed into injectable samples (Experiments) by one or more of the sample prep staff.  There is a request system for PIs and post-docs to use for scheduling sample preparation.');
INSERT INTO home_menu_sections VALUES(6,'Experiments','Experiments (Prepared Sample)','6','Experiments are injectable samples that are prepared from biomaterial. All experiments must be entered into DMS in order to be run on the instruments. You would enter a sample prep request to have your biomaterial processed into experiments.');
INSERT INTO home_menu_sections VALUES(7,'Requested Run','Requested Run','7','A Requested Run is a request that a specific experiment be run on an LCMS instrument to produce a Dataset.  An individual LCMS request must be entered for each instrument run, including replicates and blanks.');
INSERT INTO home_menu_sections VALUES(8,'Datasets','Datasets (LCMS Run)','8','Datasets represent a specific injectable sample (i.e. an aliquot of an Experiment) that is run on a particular instrument. An individual LCMS request must be entered for each instrument run, including replicates and blanks.');
INSERT INTO home_menu_sections VALUES(9,'Analysis Request','Analysis Job Request','9','An Analysis Job Request is a request that data analysis be performed on one or more Datasets.');
INSERT INTO home_menu_sections VALUES(10,'Data Analysis','Data Analysis','10','An analysis job is an automated process that analyzes the spectra for a single Dataset using a specific analysis tool (SEQUEST / X!Tandem/ ICR-2LS, etc.). You must enter an analysis job request to define the analysis job to be run.');
